import React from 'react';
import HomePage from './pages/homepage.component';
import { Route, Link } from 'react-router-dom';
import './App.css';

const HatsPage = () => (
  <div>
    <h1>HatsPage</h1>
  </div>
)

const Home = (props) => {
  console.log(props)
  return (
    <div>
      <Link to='/samuel/blob/topics'>Topics</Link>
      <button onClick={() => props.history.push('/samuel/blob/topics')}>Topics By History</button>
      <h1>Home Page</h1>
    </div>
  );  
}

const Topics = (props) => {
  console.log(props)
  return (
    <div>
      <h1>Topics Page - {props.location.pathname}</h1>
      <ul>
        <li>
          <Link to={`${props.location.pathname}/10`}>Topic Detail #10</Link>          
        </li>
        <li>
          <Link to={`${props.location.pathname}/20`}>Topic Detail #20</Link>          
        </li>
        <li>
          <Link to={`${props.location.pathname}/30`}>Topic Detail #30</Link>          
        </li>
        <li>
          <Link to={`${props.location.pathname}/40`}>Topic Detail #40</Link>          
        </li>
      </ul>
    </div>
  )
}

const TopicsDetail = props => {
  console.log(props)
  return <h1>Topic Detail Page :: {props.match.params.topicId}</h1>
}

function App() {
  return (
    <div>
      {/* <Switch>
        <Route exact path="/" component={HomePage} />
        <Route path="/hatspage" component={HatsPage} />  
      </Switch>       */}

      <Route exact path="/" component={Home} />
      <Route exact path="/samuel/blob/topics" component={Topics} />
      <Route exact path="/samuel/blob/topics/:topicId" component={TopicsDetail} />
    </div>
  );
}

export default App;
